func TestReversewordsords(t *testing.T) {

	for i, v := range tests {
		t.Log("test: ", i+1)
		got := reverseWordsV2(v.input)
		assert.Equal(t, v.expected, got)
	}
}

func BenchmarkGcdOfStrings(b *testing.B) {
	funcs := []struct {
		name string
		f    func(string) string
	}{
		{"mine", reverseWords},
		{"mine-V2", reverseWordsV2},
		{"leet-fastest", reverseWords_leet0ms},
	}

	var res string
	for _, fun := range funcs {
		b.Run(fun.name, func(b *testing.B) {
			b.ReportAllocs()
			b.ResetTimer()
			for k := 0; k < b.N; k++ {
				res = fun.f(tests[k%len(tests)].input)
			}

		})
	}

	result = res
}
